import babe from "../../images/babe.png";

export const RightDashboard = () => {    
    return (
        <>

            <div className="right" style={{width: "70%", justifyContent:"center", display:"flex", backgroundColor: "#F8F9FA", height: "100%"}}>
                <div className="mt-16">
                    <img src={babe} style={{width: "410px", height: "650px", borderRadius: "10px"}} alt="Girl" />
                </div>
            </div>

        </>
    )
}
